import { Route, Routes } from 'react-router-dom';
import './App.css';

import Home from './components/Home';
import Nav from './components/Nav';


function App() {
  return (
    <div className="App">
     <Routes>
      <Route path='/' component = {Home}/>
      <Route path='/'render ={() =><Nav />} />
      </Routes>

    </div>
  );
}

export default App;
